import React from "react";
import NavBar from "../browse/NavBar.jsx";
import SearchForm from "./SearchForm.jsx";

import styles from "./Search.module.css";

const Search = () => {
  return (
    <React.Fragment>
      <NavBar />
      <div className={styles.formstyle}>
        <SearchForm />
      </div>
    </React.Fragment>
  );
};

export default Search;
